  false,\n\t\"url\": null,\n\t\"notes\": \"Bernardin-Lochmueller and Associates (BLA)
  created an Indiana subset of the NTAD airports dataset described below. Dataset
  includes airports, heliports, seaplane bases, and stolports that are publicly owned,
  or privately owned but open to the public, or owned by the U.S. military.u00a0The
  following landing facilities have been excluded:u00a0 private landing facilities
  not open to the public, glider ports and ultra light landing facilities, as well
  as landing facilities that do not have a current LOCID assigned to them. All facilities
  are within the Great Lakes (AGL) FAA Region. Effective date of the data is January
  25, 2001. National Transportation Atlas Database metadata states u0096 u0093The
  Public-Use Airports database is a geographic point database of aircraft landing
  facilities in the United States and U.S. Territories.u00a0 Attribute data is provided
  on the physical and operational characteristics of the landing facility, current
  usage including enplanements and aircraft operations, congestion levels and usage
  categories.u0094\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
